	  showPluginTab: function showPluginTab(name) {
	    var active = 'Home';
	    var tabs = this.state.tabs || [];
	    if (name && name != active) {
	      for (var i = 0, len = tabs.length; i < len; i++) {
	        if (tabs[i].name == name) {
	          active = name;
	          name = null;
	          break;
	        }
	      }
	    }
	    var plugin = name && this.state.plugins[name + ':'];
	    if (plugin) {
	      if (tabs.length >= MAX_PLUGINS_TABS) {
	        win.alert('At most ' + MAX_PLUGINS_TABS + ' tabs can be opened at the same time.');
	        return this.showPlugins();
	      }
	      active = name;
	      if (plugin.pluginHomepage && !plugin.openInPlugins) {
	        return window.open(plugin.pluginHomepage);
	      }
	      tabs.push({
	        name: name,
	        url: plugin.pluginHomepage || 'plugin.' + name + '/'
	      });
	    }
	
	    this.setState({
	      active: active,
	      tabs: tabs
	    });
	  },
	  activePluginTab: function activePluginTab(e) {
	    this.showPluginTab($(e.target).attr('data-name'));
	  },
	  closePluginTab: function closePluginTab(e) {
	    var name = $(e.target).attr('data-name');
	    var tabs = this.state.tabs || [];
	    if (tabs) {
	      for (var i = 0, len = tabs.length; i < len; i++) {
	        if (tabs[i].name == name) {
	          tabs.splice(i, 1);
	          var active = this.state.active;
	          if (active == name) {
	            var plugin = tabs[i] || tabs[i - 1];
	            this.state.active = plugin ? plugin.name : null;
	          }
	
	          return this.setState({
	            tabs: tabs
	          });
	        }
	      }
	    }
	  },
