	    var name = $.trim(target.value);
	    if (!name) {
	      message.error('The name cannot be empty.');
	      return;
	    }
	
	    if (/\s/.test(name)) {
	      message.error('The name cannot contain spaces.');
	      return;
	    }
	
	    if (/#/.test(name)) {
	      message.error('The name cannot contain #.');
	      return;
	    }
	
