	  replay: function replay(e, list, count) {
	    var modal = this.state.network;
	    list = Array.isArray(list) ? list : modal.getSelectedList();
	    if (!list || !list.length) {
	      return;
	    }
	    this.enableRecord();
	    var replayReq = function replayReq(item) {
	      var req = item.req;
	      dataCenter.compose2({
	        useH2: item.useH2 ? 1 : '',
	        url: item.url,
	        headers: util.getOriginalReqHeaders(item),
	        method: req.method,
	        base64: req.base64
	      });
	    };
	    var map;
	    if (count > 1) {
	      count = Math.min(count, MAX_REPLAY_COUNT);
	      var reqItem = list[0];
	      for (var i = 0; i < count; i++) {
	        replayReq(reqItem);
	      }
	    } else {
	      map = {};
	      list.slice(0, MAX_REPLAY_COUNT).forEach(function (item) {
	        map[item.id] = 1;
	        replayReq(item);
	      });
	    }
	    if (modal.isTreeView) {
	      var dataId = dataCenter.lastSelectedDataId;
	      if (!dataId) {
	        return;
	      }
	      if (!map) {
	        return events.trigger('replayTreeView', [dataId, count]);
	      }
	      var node = dataId && modal.getTreeNode(dataId);
	      node = node && node.parent;
	      if (!node) {
	        return;
	      }
	      count = 0;
	      node.children.forEach(function (item) {
	        item = item.data;
	        if (item && map[item.id]) {
	          ++count;
	        }
	      });
	      events.trigger('replayTreeView', [dataId, count]);
	    } else if (this.autoRefresh) {
	      this.autoRefresh();
	    }
	  },
